import React from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import "../css/Home.css";
import Header from "../components/Header";

function Index1() {
  return (
    <div className="index-even" id="index-1">
        <Header string="about me" />
    </div>
  )
}

function Home() {
  return (
    <div className="index-wrapper">
      <div id="top"></div>
      <Index1 />
    </div>
  );
}

export default Home;
